DROP TABLE IF EXISTS wines;

CREATE TABLE IF NOT EXISTS wines(
	seq INTEGER PRIMARY KEY AUTOINCREMENT,
	class INT,
	alcohol INT,
	malicAcid INT,
	ash INT,
	alkalinity INT,
	mg INT,
	phenols INT,
	flavanoids INT,
	nonPhenols INT,
	proanthos INT,
	intensity INT,
	hue INT,
	od280 INT,
	proline INT
);




